/**
 * Get detalhamento by number
 * @param {string} numero - The drawing number
 * @returns {{numero: string, tipo: string, pdf: string|null, dwg: string|null}|null} The detalhamento entry or null
 */
export function getDetalhamentoByNumero(numero) {
  return DETALHAMENTO_INDEX[numero] || null;
}

/**
 * Get all detalhamentos by type
 * @param {string} tipo - The type (e.g., "COLUNA", "VIGA")
 * @returns {Array<{numero: string, tipo: string, pdf: string|null, dwg: string|null}>>} Array of matching entries
 */
export function getDetalhamentosByTipo(tipo) {
  return Object.values(DETALHAMENTO_INDEX).filter(entry => entry.tipo === tipo);
}

